    const { tournamentId } = useParams();
    const tournament = useSelector(selectTournamentById(tournamentId));
    console.log('%csrc/pages/TournamentDetailsPage.js:9 object', 'color: #007acc;', tournament);
    return (
        <Container className="mt-5 tournament-details">
             <div className="tournament-details__image position-relative">
                <img className="w-100 card-image" src="https://picsum.photos/1400/700"/>
                <div></div>
             </div>
        </Container>
    );
};

export default TounramentDetailsPage;
